import React from 'react';
import { Button } from '@mui/material';

function Footer() {
  return (
    <hr>
    <div class="footer-container">
      <div class="footer-container-column">
          <h3>Resources</h3>
      </div>
      <div class="footer-container-column">
          <h3>Developer</h3>
      </div>
      <div class="footer-container-column">
          <h3>Help</h3>
      </div>
      <div class="footer-container-column">
          <h3>Contact</h3>
      </div>
    </div>
    </hr>
  );
}

export default Footer;
